// SPDX-License-Identifier: MIT
pragma solidity >=0.4.21;
pragma experimental ABIEncoderV2;
import './Operations.sol';

contract CenterContract is Operations{

    struct centerStruct {
      string centername;
      string centerID;
      string areaCode;
      string phone;
      string email;
      string Caddress;
    }
    mapping (address => string) public centerIdMap;
    mapping (string => centerStruct) public centerDetailsMap;

    uint Centercount;

    constructor() public {
        Centercount=0;
    }

    function registerUser(address _cmpaddr, string memory cname, string memory email, string memory phone,
                                            string memory Caddress, string memory area_code ) public 
    {
        Centercount++;
        //Convert int to string 
        string memory H="U";
        string memory CenterID=concatenate(H,IntToString(Centercount));

        centerIdMap[_cmpaddr]=CenterID;
        centerDetailsMap[CenterID]=centerStruct(cname,CenterID,email,phone,Caddress,area_code);
    }

    function getCenterID(address _usraddr) public view returns (string memory _userID) {
        return centerIdMap[_usraddr];
    }

    function getCenter(string memory CenterID) public view returns (centerStruct memory _centerStruct) {
        return centerDetailsMap[CenterID];
    }

}
